#date_to_tradeday(start_date,swift_month,hk_mkt=0,error_direction=0) 
#返回最近一个交易日，如20190701
#start_date:初始日期；
#swift_month：变动月数，向前为负，向后为正；
#hk_mkt:是否考虑交易日为港股通交易日，默认不考虑，设为1则考虑
#error_direction：若不为交易日的处理方式，默认为向前取最近交易日，设为1则向后取最近的交易日
#目前wind数据库内的日历更新至2020年12月31日，后续需定期更新；港股通日期临时变化时需手动调整。

def date_to_tradeday(start_date,swift_month,hk_mkt=0,error_direction=0):

    import pandas as pd
    import datetime as dt
    import time
    from dateutil.relativedelta import relativedelta
    
    #json转dataframe
    AShareCalendar_wind=pd.read_json(AShareCalendar_wind_json,encoding = 'GB2312')
    
    #读取初始日期的年月日数据，转为日期格式
    start_date_year=time.strptime(str(start_date), '%Y%m%d').tm_year
    start_date_month=time.strptime(str(start_date), '%Y%m%d').tm_mon
    start_date_day=time.strptime(str(start_date), '%Y%m%d').tm_mday
    temp_date=dt.date(start_date_year,start_date_month,start_date_day)
    
    #temp_date2:平移后的日期，num为其数字格式
    temp_date2=temp_date+relativedelta(months=swift_month)
    temp_date2_num=int(temp_date2.strftime('%Y%m%d'))
    
    #若考虑港股通交易日，则同时判断上交所交易日和沪港通交易日
    if hk_mkt==1:
        while not('SSE' in AShareCalendar_wind[AShareCalendar_wind['TRADE_DAYS']==temp_date2_num].S_INFO_EXCHMARKET.values and \
        'SHN' in AShareCalendar_wind[AShareCalendar_wind['TRADE_DAYS']==temp_date2_num].S_INFO_EXCHMARKET.values):
            temp_date2 += dt.timedelta( 1 if error_direction==1 else -1 )    
            temp_date2_num=int(temp_date2.strftime('%Y%m%d'))
    
    else:
        while not('SSE' in AShareCalendar_wind[AShareCalendar_wind['TRADE_DAYS']==temp_date2_num].S_INFO_EXCHMARKET.values):
            temp_date2 += dt.timedelta( 1 if error_direction==1 else -1 )
            temp_date2_num=int(temp_date2.strftime('%Y%m%d'))
    return temp_date2_num

